import React from 'react';
import './search-panel.css'
const SearchPanel = () => {
    const searchStyle ={
        fontSize:'25px'
    }
    const searchText = "Type your text here, please"
    return (
    <input 
    style = {searchStyle} //style in component
    placeholder={searchText } />)
}
export default SearchPanel;
